 @marcosfc1969  Cara, seu comentário simplesmenta não faz sentido nenhum kkkk. Eu explique da melhor forma possível o pq o lance do arrasca não ser pra expulsão, e ainda mandei um exemplo mostrando um lance parecido, mas não, vc não aceita e acha que seu time que só marcou gol por irregularidade, e que foi prejudicado kkkkkkkkk
E não vem com esse papo de "Ain todo mundo tá falando" pq é mentira! O único lance realmente muito falado do jogo, foi justamente o gol irregular do seu time. Sem isso nem teriam saído do 0, e acha que mereceram alguma coisa.
E como assim quando?? O lance do Gerson foi uma disputa área no primeiro tempo, onde o zaracho usa o braço pra ter vantagem! Lance claro pra amarelo e o árbitro só deu falta. Se vc não viu, não opine. E outra, só o Gerson e melhor que 98% desse seu time! Então é complicado tu querer comparar os bagre do seu time com o Gerson ne?? Kkkkk
